import React, { 
  Component 
} 
from 'react';

import {
  Drum,
  Grid,
  Row,
  Column
}
from "./components";

class App extends Component {
  render() {
    return (
      <Row>
        <Column>
          <Grid>
            <Drum name="q"/>
            <Drum name="w"/>
            <Drum name="e"/>

            <Drum name="a"/>
            <Drum name="s"/>
            <Drum name="d"/>

            <Drum name="z"/>
            <Drum name="x"/>
            <Drum name="c"/>
          </Grid>
        </Column>

        <Column>
          <div className="form-group">
            <input 
            type="range" 
            onChange={e => console.log(e.target.value)} 
            className="form-control-range"/>
          </div>
        </Column>
      </Row>
    );
  }
}

export default App;
